import React, {useState} from 'react';
import * as cal from './Heading.jsx';
import contact from './contacts.js'
import './index.css'

function App() {
  var time =  new Date().getHours();
  var greeting;
  var entername;
  var [numberz, setNumber] = useState(new Date())
  
  var sitai = {
  color: "yellow",
  fontSize: "20px",
  }
  setInterval ( () => {setNumber(numberz = new Date())});
  if (time >= 0 && time < 12){
      greeting = "Good morning, it's " + numberz;
      sitai.color = "red";
  } else if (time >= 12 && time < 18){
      greeting = "Good afternoon, it's " + numberz;
      sitai.color = "blue";
  } else {
      greeting = "Good evening, it's " + numberz;
      sitai.color = "green";
  }
  return  <h1 style = {sitai}>{greeting}</h1>
    return contact.map( contact => 
      <cal.Cardz 
      key = {contact.id}
      id = {contact.id}
      name = {contact.name}
      tel = {contact.tel}
      email = {contact.email}
      />)
}
export default App;
